        return new Source("<!DOCTYPE html>
<html>
<head>
    <meta charset=\"UTF-8\">
    <title>{% block title %}Welcome!{% endblock %}</title>
    {% block stylesheets %}
        <link rel=\"stylesheet\" href=\"https://cdn.jsdelivr.net/npm/bootstrap@4.5.3/dist/css/bootstrap.min.css\" integrity=\"sha384-TX8t27EcRE3e/ihU7zmQxVncDAy5uIKz4rEkgIXeMed4M0jlfIDPvg6uqKI2xXr2\" crossorigin=\"anonymous\">
    {% endblock %}
</head>
<body>
{% block header %}
    <nav class=\"navbar navbar-expand-lg navbar-light bg-light\">
        <a class=\"navbar-brand\" href=\"/\">Indeed</a>
        <button class=\"navbar-toggler\" type=\"button\" data-toggle=\"collapse\" data-target=\"#navbarSupportedContent\" aria-controls=\"navbarSupportedContent\" aria-expanded=\"false\" aria-label=\"Toggle navigation\">
            <span class=\"navbar-toggler-icon\"></span>
        </button>

        <div class=\"collapse navbar-collapse\" id=\"navbarSupportedContent\">
            <ul class=\"navbar-nav mr-auto\">
                <li class=\"nav-item active\">
                    <a class=\"nav-link\" href=\"/\">Les offres<span class=\"sr-only\">(current)</span></a>
                </li>
                <li class=\"nav-item active\">
                    <a class=\"nav-link\" href=\"/add\">Ajouter une offre</a>
                </li>
            </ul>
            {% if is_granted('IS_AUTHENTICATED_FULLY') -%}
                <form class=\"form-inline my-2 my-lg-0\">
                    <a class=\"btn btn-outline-danger m-2 my-sm-0\" type=\"submit\" href=\"/logout\">Disconnection</a>
                </form>
            {% else %}
                <form class=\"form-inline my-2 my-lg-0\">
                    <a class=\"btn btn-outline-success m-2 my-sm-0\" type=\"submit\" href=\"/login\">Login</a>
                    <a class=\"btn btn-outline-success m-2 my-sm-0\" type=\"submit\" href=\"/register\">Sign up</a>
                </form>
            {% endif %}

        </div>
    </nav>
{% endblock %}
{% block body %}{% endblock %}
{% block javascripts %}
    <script src=\"https://code.jquery.com/jquery-3.5.1.slim.min.js\" integrity=\"sha384-DfXdz2htPH0lsSSs5nCTpuj/zy4C+OGpamoFVy38MVBnE+IbbVYUew+OrCXaRkfj\" crossorigin=\"anonymous\"></script>
